import React, { useState } from "react";

function TeamProfile(props) {
  const [profile, setProfile] = useState([
    {
      id: 555,
      name: "Ahmed BENMOUH",
      Occupation: "developer",
      img: "https://picsum.photos/id/100/200/300",
    },
    {
      id: 666,
      name: "Taha Olavi",
      Occupation: "doctor",
      img: "https://picsum.photos/id/19/200/300",
    },
    {
      id: 777,
      name: "Jasin Hermanni",
      Occupation: "business man",
      img: "https://picsum.photos/id/88/200/300",
    },
  ]);
  return (
    <>
      <div className="">
        <img src={props.profile.img} />
      </div>
    </>
  );
}

export default TeamProfile;
